const Holiday =  [
    {
      id: 0,
      title:"출근",
      allDat:false,
      start: new Date(2021, 8, 9),
      end: new Date(2021, 8, 10),
    },
    {
      id: 1,
      title:"퇴근",
      allDat:false,
      start: new Date(2021,11,9,10,0),
      end: new Date(2021,11,9,10,30)
    }
  ];
 
export default Holiday;
